import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const UpdateReplacement = () => {
  return (
    <View>
      <Text>UpdateReplacement</Text>
    </View>
  )
}

export default UpdateReplacement

const styles = StyleSheet.create({})
